node.text:
A few weeks ago we celebrated @teamchancebasketball taking a NEW CHANCE and closing his chapter in law enforcement!  I’m so thankful to all the people who came and poured into him that night!  We weren’t just giving @teamchancebasketball his flowers that night, we were giving him the water to help him grow!! So many friends and family couldn’t make it, but I hope this video will help you all feel like you were there!! These are just some of the  moments captured that tell you a little bit about how special Chance is to so many people! 
Thank you again to @lenoiragency.la for the best party ever, you did a phenomenal job!! 
@plateofhue as always honey that food was the talk of the night!! Thank you and @chefjennabarr 

Thank you to everyone who made this night so special:

some of these I know you have but these are all of the vendors ♥️

